import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Register from './pages/Register/Register';
import Login from './pages/Login/Login';

function App() {
  return (
   <BrowserRouter>
   <div className='container'>
      <Routes>

      <Route path='/' element={<Login/>}/>
      <Route path='/register' element={<Register/>}/>

      </Routes>
      </div>
   </BrowserRouter>
  );
}

export default App;
